import{_ as l}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as e,e as a}from"./app-85442c0b.js";const p={},r=a('<h1 id="swagger常用注解" tabindex="-1"><a class="header-anchor" href="#swagger常用注解" aria-hidden="true">#</a> Swagger常用注解</h1><ul><li><p>@Api: 用在控制器类上，表示对类的说明</p><ul><li>tags: 说明该类的作用，可以在UI界面上看到的说明信息的一个注解</li></ul></li><li><p>@ApiOperation: 用在请求的方法上，说明方法的用途、作用</p><ul><li>value: 说明方法的用途、作用</li><li>note: 辅助说明，更详细的描述</li></ul></li><li><p>@ApiImplicitParams: 用在请求的方法上，表示一组参数说明</p><ul><li>@ApiImplicityParam: 详细概括参数的各个方面 <ul><li>name: 方法参数名</li><li>value: 参数意义</li><li>required: 是否必须传</li><li>paramType: 参数放在的地方 <ul><li>header: 从@RequestHeader获取</li><li>query: 从@RequestParam获取</li><li>path: 从@PathVariable获取</li></ul></li><li>dataType: 参数类型，默认String</li><li>defaultValue: 默认值</li></ul></li></ul></li><li><p>@ApiResponses: 用在请求的方法商，表示一组响应说明</p><ul><li>@ApiResponse: 表达一个错误的响应信息 <ul><li>code: 错误状态码</li><li>message: 错误消息</li><li>reponse: 抛出的异常类</li></ul></li></ul></li><li><p>@ApiModel: 用在响应类(POJO实体类)上，描述POJO类请求或响应的实体说明，这种一般用在post接口的时候，使用@RequestBody接收JSON格式的数据的场景，请求参数无法使用@ApiImplicitParam注解进行描述的时候</p><ul><li>@ApiModelProperty: 描述类的属性 <ul><li>value: 属性的描述</li><li>dataType: 属性类型</li><li>name: 属性名</li><li>example: 示例</li></ul></li></ul></li><li><p>@ApiIgnore: 生成文档时忽略这个接口</p></li></ul>',2),t=[r];function u(s,o){return i(),e("div",null,t)}const d=l(p,[["render",u],["__file","Swagger.html.vue"]]);export{d as default};
